import React from 'react';
import './App.css';
import ReactCanvasNest from 'react-canvas-nest';

class App extends React.Component {
  render() {
    return ( 
      <div className='App'>
      <div className='logo'>haha</div>
        <ReactCanvasNest className = 'canvasNest' config = {{ pointColor: ' 255, 255, 255 ' }} style = {{zIndex: 99 },{position: fixed}} />
      </div> 
      )
  }
}

export default App;
